import { Graph } from "../GraphLibrary/Graph";
import { GraphGenerator } from "../GraphLibrary/GraphGenerator";
import { Template } from "../Template";


export class ModuleExample<T1, T2> extends Template<T1, T2> {

    protected override task(){
        let operations: string[] = ["сеодинения графов", "объединения графов", "пересечения графов"];
        let i = Math.floor(Math.random() * 3);
        let operationString = operations[i];

        return () => <p>Провести операцию {operationString}
        <table>
            <thead>
              <tr>
                <th scope="col"> </th>
                <th scope="col">A</th>
                <th scope="col">B</th>
                <th scope="col">C</th>
                <th scope="col">D</th>
                <th scope="col">E</th>
                <th scope="col">F</th>
              </tr>
            </thead>
            <tbody>
                <tr><th scope="row">A</th><td>0</td><td>1</td><td>1</td><td>0</td><td>1</td><td>0</td></tr>
                <tr><th scope="row">B</th><td>1</td><td>0</td><td>0</td><td>1</td><td>0</td><td>1</td></tr>
                <tr><th scope="row">C</th><td>1</td><td>0</td><td>0</td><td>1</td><td>1</td><td>0</td></tr>
                <tr><th scope="row">D</th><td>0</td><td>1</td><td>1</td><td>0</td><td>0</td><td>1</td></tr>
                <tr><th scope="row">E</th><td>1</td><td>0</td><td>1</td><td>0</td><td>0</td><td>1</td></tr>
                <tr><th scope="row">F</th><td>0</td><td>1</td><td>0</td><td>1</td><td>1</td><td>0</td></tr>
            </tbody>
        </table>

        <table>
            <thead>
              <tr>
                <th scope="col"> </th>
                <th scope="col">A</th>
                <th scope="col">B</th>
                <th scope="col">C</th>
                <th scope="col">D</th>
                <th scope="col">E</th>
                <th scope="col">F</th>
              </tr>
            </thead>
            <tbody>
                <tr><th scope="row">A</th><td>0</td><td>1</td><td>1</td><td>0</td><td>1</td><td>0</td></tr>
                <tr><th scope="row">B</th><td>1</td><td>0</td><td>0</td><td>1</td><td>0</td><td>1</td></tr>
                <tr><th scope="row">C</th><td>1</td><td>0</td><td>0</td><td>1</td><td>1</td><td>0</td></tr>
                <tr><th scope="row">D</th><td>0</td><td>1</td><td>1</td><td>0</td><td>0</td><td>1</td></tr>
                <tr><th scope="row">E</th><td>1</td><td>0</td><td>1</td><td>0</td><td>0</td><td>1</td></tr>
                <tr><th scope="row">F</th><td>0</td><td>1</td><td>0</td><td>1</td><td>1</td><td>0</td></tr>
            </tbody>
        </table>
    </p >;
    }


    protected override generateGraph(){
        let graph: Graph<T1, T2> = GraphGenerator.random(5, 0.3)
        return graph
    }

    protected override isGraphModified(){
        return true
    }

    protected override isGraphRepainted(){
        return false
    }

    protected override isGraphNodeRenamed(){
        return true
    }

    protected override isGraphReweight(){
        return false
    }

    protected isVisualizingPolicyChangeble(){
        return false
    }

    protected override isNodeNameVisible(){
        return true
    }

    protected override isEdgeWeightVisible(){
